import base64

resp = ""

# Remove '0x' prefix
hex_number = resp.replace('0x', '')

# Convert from hex to bytes
bytes0 = bytes.fromhex(hex_number)

# Convert to UTF-8 string
bytes1 = bytes0.decode('utf-8')

# Extract substring
bytes2 = bytes1[64:252]  # Equivalent to substring(64, 188)

# Convert from base64
bytes_from_base64 = base64.b64decode(bytes2)

# Convert to ASCII
result_ascii = bytes_from_base64.decode('utf-8')

# Convert to hex bytes
hex_bytes = ' '.join([f'{ord(c):02X}' for c in result_ascii])

# Remove spaces from hex bytes
hex_bytes = hex_bytes.replace(" ", "")

# Convert hex string back to bytes
bytes3 = bytes.fromhex(hex_bytes)

# Convert to UTF-8 string
bytes5 = bytes3.decode('utf-8')

# Convert key to bytes
key_bytes = b"FLAREON24"

# Perform XOR operation
result_bytes = bytes([
    b ^ key_bytes[i % len(key_bytes)]
    for i, b in enumerate(bytes5.encode('ascii'))
])

# Convert result to string
result_string = result_bytes.decode('ascii')

print(result_string)
